async function handleLogin() {
    const email = document.getElementById('loginEmail').value;
    const password = document.getElementById('loginPassword').value;

    try {
        const response = await fetch('http://localhost:5000/api/auth/login', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ email, password }),
        });

        const data = await response.json();
        if (response.ok) {
            localStorage.setItem('token', data.token);
            alert('Login successful!');
            // Redirect to the dashboard or another page
        } else {
            alert(data.message);
        }
    } catch (error) {
        console.error('Error logging in:', error);
        alert('An error occurred. Please try again.');
    }
}

// Attach event listener to login form
document.getElementById('loginForm').addEventListener('submit', (e) => {
    e.preventDefault();
    handleLogin();
});

async function handleRegistration() {
    const username = document.getElementById('registerUsername').value;
    const email = document.getElementById('registerEmail').value;
    const password = document.getElementById('registerPassword').value;

    try {
        const response = await fetch('http://localhost:5000/api/auth/register', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ username, email, password }),
        });

        const data = await response.json();
        if (response.ok) {
            localStorage.setItem('token', data.token);
            alert('Registration successful!');
            // Redirect to the dashboard or another page
        } else {
            alert(data.message);
        }
    } catch (error) {
        console.error('Error registering:', error);
        alert('An error occurred. Please try again.');
    }
}

// Attach event listener to registration form
document.getElementById('registerForm').addEventListener('submit', (e) => {
    e.preventDefault();
    handleRegistration();
});
async function fetchTraders() {
    try {
        const response = await fetch('http://localhost:5000/api/traders');
        const traders = await response.json();

        const traderList = document.getElementById('traderList'); 
        traderList.innerHTML = '';

        traders.forEach(trader => {
            const traderItem = document.createElement('div');
            traderItem.innerHTML = `
                <h3>${trader.username}</h3>
                <p>Performance: ${trader.performance}%</p>
                <p>${trader.bio}</p>
                <button onclick="viewTrader('${trader._id}')">View Profile</button>
            `;
            traderList.appendChild(traderItem);
        });
    } catch (error) {
        console.error('Error fetching traders:', error);
    }
}

// Call this function when the trader list page is loaded
fetchTraders();
